const Awards = (props) => {
    //Award generation
    var yearArray = props.awards.split('|');
    var col1 = [];

    function awardSplitter(awardArray,i){
        var col1 = [];
        for (var i=0; i<awardArray.length; i++){
            var pointsArray = awardArray[i].split('-');
            col1.push(<p><b style={{color:'black'}}>{pointsArray[0]}</b></p>);
            col1.push(<div style={{height:'0px',width:'100%'}}></div>);
            for (var j=1; j<pointsArray.length; j++){
                col1.push(<p>{pointsArray[j]} </p>);
                col1.push(<div style={{height:'0px',width:'100%'}}></div>);
            }
        }
        return col1;
    }

    for (var a=0; a<yearArray.length; a=a+2){
        col1.push(<div className="col"><h1>{yearArray[a]}</h1></div>)
        if(i!=yearArray.length){
            col1.push(<div style={{height:'0px',width:'100%',border: '2px solid #651FFF',marginBottom:'12px'}}></div>);
        }
        var awardArray=yearArray[a+1].split(",");
        var splitterResult=awardSplitter(awardArray,i);
        col1.push(<div className="col">{splitterResult}</div>)

    }

    return (
    <div className="row bound">
        {col1}
    </div>
    )
}

export default Awards
